const CertificateSection = () => {
  const [tag, setTag] = useState("All");
  const ref = useRef(null);
  const isInView = useInView(ref, { once: true });

  const handleTagChange = (newTag) => {
    setTag(newTag);
  };

  const filteredProjects = certificatedata.filter((certificate) =>
  certificate.tag.includes(tag)
  );

  const cardVariants = {
    initial: { y: 50, opacity: 0 },
    animate: { y: 0, opacity: 1 },
  };

  return (
    <section id="certificates" className="mt-10">
      <h2 className=" text-center text-4xl font-bold text-white mt-4 mb-8 md:mb-12">
        My Certificates
      </h2>
      <div className="text-white flex flex-row justify-center items-center gap-1 py-6">
        <CertificateTag
          onClick={handleTagChange}
          name="All"
          isSelected={tag === "All"}
        />
        <CertificateTag
          onClick={handleTagChange}
          name="Web"
          isSelected={tag === "Web"}
        />
        <CertificateTag
          onClick={handleTagChange}
          name="programming"
          isSelected={tag === "programming"}
        />
        {/* <CertificateTag
          onClick={handleTagChange}
          name="Tech"
          isSelected={tag === "Tech"}
        /> */}
        <CertificateTag
          onClick={handleTagChange}
          name="others"
          isSelected={tag === "others"}
        />
      </div>
      <ul ref={ref} className="grid md:grid-cols-3 gap-8 md:gap-12">
        {filteredProjects.map((project, index) => (
          <motion.li
            key={index}
            variants={cardVariants}
            initial="initial"
            animate={isInView ? "animate" : "initial"}
            transition={{ duration: 0.3, delay: index * 0.4 }}
          >
            <CertificateCard
              key={project.id}
              title={project.title}
              description={project.description}
              imgUrl={project.image}
              gitUrl={project.gitUrl}
              previewUrl={project.previewUrl}
            />
          </motion.li>
        ))}
      </ul>
    </section>
  );
};

export default CertificateSection;
